const progressNames = ["To Do", "In Progress", "Complete", "Pending", "Cancel"];
const progressColors = {
    "To Do": "#95a5a6",       // Màu đỏ cam
    "In Progress": "#3498db", // Màu xanh dương
    "Complete": "#28a745",    // Màu xanh lá
    "Pending": "#f39c12",     // Màu vàng
    "Cancel": "#e74c3c"       // Màu tím
};
// Trích xuất danh sách dịch vụ từ dữ liệu
const serviceNames = [...new Set(this.Data[0].map(item => item.name))];

// Chuyển đổi dữ liệu từ SQL thành cấu trúc phù hợp
const formattedData = serviceNames.map(() => Array(progressNames.length).fill(0));

// Gán dữ liệu từ `this.Data[0]` vào `formattedData`
this.Data[0].forEach(item => {
    const serviceIndex = serviceNames.indexOf(item.name);
    const progressIndex = item.ProgressId - 1; // ProgressId từ 1 -> 5

    if (serviceIndex !== -1 && progressIndex >= 0 && progressIndex < progressNames.length) {
        formattedData[serviceIndex][progressIndex] = item.value;
    }
});

// Tính tổng giá trị của mỗi dịch vụ
const serviceTotals = formattedData.map(row => row.reduce((sum, val) => sum + val, 0));

// Sắp xếp theo tổng giá trị **tăng dần**
const sortedIndexes = serviceTotals
    .map((total, index) => ({ total, index }))
    .sort((a, b) => a.total - b.total) // Đổi thành tăng dần
    .map(item => item.index);

// Sắp xếp lại `serviceNames` và `formattedData` theo thứ tự mới
const sortedServiceNames = sortedIndexes.map(index => serviceNames[index]);
const sortedFormattedData = sortedIndexes.map(index => formattedData[index]);

return {
    title: {
        left: 'left',
        text: 'Inquiry'
    },
    tooltip: {
        trigger: 'axis',
        axisPointer: { type: 'shadow' }
    },
    legend: { data: progressNames },
    grid: {
        left: '3%', right: '4%', bottom: '3%', containLabel: true
    },
    xAxis: { type: 'value' },
    yAxis: {
        type: 'category',
        data: sortedServiceNames // Đã sắp xếp theo tổng giá trị nhỏ -> lớn
    },
    series: progressNames.map((progress, index) => ({
        name: progress,
        type: 'bar',
        stack: 'total',
        label: { show: true },
        emphasis: { focus: 'series' },
        itemStyle: { color: progressColors[progress] },
        data: sortedFormattedData.map(row => row[index]) // Dữ liệu cũng được sắp xếp lại
    }))
};

